t.push(new R.cj("Lampe Weda","Weda ist Germanisch und bedeutet Wald. Eine Lampe aus den unterschiedlichsten H\xf6lzern, die geschickt verschraubt einen Dreifu\xdf bilden, der f\xfcr optimale Standfestigkeit sorgt. In Kombination mit einem wei\xdfen Lampenschirm perfekt abgerundet ergibt das ein einzigartiges M\xf6belst\xfcck f\xfcr Ihr Zuhause.","lib/images/Weda.jpg"))
