t.push(new R.cj("Lampe Maranga","Maranga ist Maori und bedeutet Aufgang. Eine ausgeh\xf6hlte Borke ist die Basis dieses Projekts und bringt in Verbindung mit warmen Farben nicht allzu viel Licht ins Dunkel. Dennoch schafft Sie es, mit Ihrer rustikalen Ader zu \xfcberzeugen. Ideal f\xfcr R\xe4ume, in denen man Akzente setzen m\xf6chte.","lib/images/Maranga.jpg"))
