t.push(new R.cj("Lampe Ibaleke","Ibaleke ist Zulu und bedeutet gerader Weg. Eine Lampe aus Fichtenholz und einem Standbein aus Grafitstein bilden zusammen ein sehr geradliniges Design, das von Bordeauxfarben abgerundet wird.","lib/images/Ibaleke.jpg"))
t.push(new R.cj("Halskette Elegansie","Elegansie ist Afrikanisch und steht f\xfcr Eleganz. Eine Halskette aus Fichtenholz, das durch Flammen und Hitze zu einem Unikat geformt wurde. Unz\xe4hlige Schleifarbeiten und 4K Gold sorgen f\xfcr besten Tragekomfort, womit Sie auch endlose Tage \xfcberstehen.","lib/images/Elegansie.jpg"))
t.push(new R.cj("Wandbild Avikele","Avikele ist Zulu und bedeutet Schild. Eine schwere Konstruktion, die aus 95 Buchenelementen besteht, kreiert eine Form, die einem Schild nahekommt. In Verbindung mit einer indirekten Beleuchtung schafft sie es, durch hohe Pr\xe4sens direkt herauszustechen und klaut jedem Gem\xe4lde die Show.","lib/images/Avikele.jpg"))
t.push(new R.cj("Flaschenhalterung Antiguo","Antiguo ist Spanisch und bedeutet alt. Eine Flaschenhalterung aus Eichenholz, das mehr als ein halbes Jahrhundert jeder Witterung trotzte. Eine faszinierende Oberfl\xe4che, die Geschichten erz\xe4hlt, l\xe4sst jedes Weinfass alt aussehen. Die verwitterte Rinde bildet dazu den perfekten Kontrast und l\xe4dt zu einem Drink ein.","lib/images/Antiguo.jpg"))
t.push(new R.cj("Glasuntersetzer Aniani","Aniani ist Hawaiisch und bedeutet Glas. Das Fundament bildet hier eine Fichte, die im Arrangement mit Kristallgl\xe4sern die Spuren der Natur noch besser zur Geltung bringt. \xdcberzeugt durch Vielfalt!","lib/images/Aniani.jpg"))
t.push(new R.cj("Lampe Volamena","Volamena ist Madagassisch und bedeutet Gold. Eine Lampe aus Erlenholz deren Form einer Muschel nahe kommt wird von einem Lampenschirm mit Goldeinlage indirekt reflektiert. Ein Schieferstein mit Pyritgoldeinlagen sorgt f\xfcr eine erstklassige Abrundung des Gesamtbildes.","lib/images/Volamena.jpg"))
t.push(new R.cj("Lampe Arena","Arena ist Spanisch und bedeutet Sand. Eine Lampe aus Buche deren Formgebung stark einer W\xfcstenlandschaft \xe4hnelt. Aufgrund der fein geb\xfcrsteten Oberfl\xe4che schmeichelt Sie nicht nur den Augen sondern verleitet auch zu einer Ber\xfchrung. Der Italienische Marmor bringt die einzelnen Komponenten in Einklang und sorgt f\xfcr hochwertige Eleganz.","lib/images/Arena.jpg"))
